// Admin.js
import React from 'react';

function Admin({ generateDiscountCode, purchaseInfo, discountCodes }) {
  return (
    <div>
      <h3>Admin Panel</h3>
      <button onClick={generateDiscountCode}>Generate Discount Code</button>
      <div>
        <h4>Discount Codes:</h4>
        <ul>
          {discountCodes && discountCodes.length > 0 ? (
            discountCodes.map((code, index) => (
              <li key={index}>{code}</li>
            ))
          ) : (
            <p>No discount codes available.</p>
          )}
        </ul>
      </div>
      <div>
        <h4>Total Discount Amount: ${purchaseInfo.totalDiscountAmount.toFixed(2)}</h4>
      </div>
    </div>
  );
}

export default Admin;
